import {Component} from 'react';
import profstyles from './profile.module.css';
import MyPosts from "./myPosts/MyPosts";

class Profile extends Component {
    render() {
        return (
            <div className={profstyles.content}>
                <div className={profstyles.left}>
                    <div className={profstyles.profileInfo}>
                        <div className={profstyles.title}>
                            <div className={profstyles.selfPhoto}>
                                {/*<img src="https://d2qp0siotla746.cloudfront.net/img/use-cases/profile-picture/template_3.jpg" alt=""/>*/}
                                <img src="https://appamatix.com/wp-content/uploads/2016/05/Anonymous-FeatPic.jpg" alt=""/>
                            </div>
                        </div>
                        <div className={profstyles.personalInfo}>
                            <span className={profstyles.nameInfo}>John Doe</span>
                            <span className={profstyles.job}>Graphic Designer at Self Employed</span>
                        </div>
                        <div className={profstyles.following}>
                            <span>Following</span>
                            <span>34</span>
                        </div>
                        <div className={profstyles.followers}>
                            <span>Followers</span>
                            <span>155</span>
                        </div>
                        <div className={profstyles.viewButton}>
                            <button>View Profile</button>
                        </div>
                    </div>
                    <div className={profstyles.suggestions}>
                        <div className={profstyles.suggestionTitle}>
                            <span>Suggestions</span>
                            <button><i className="glyphicon glyphicon-option-vertical"></i></button>
                        </div>
                        <div className={profstyles.friendItem}>
                            <div className={profstyles.photo}>
                                <img src="data:image/jpeg;base64," alt=""/>
                            </div>
                            <div className={profstyles.name}>
                                <span className={profstyles.fname}>Karina Lower</span>
                                <span className={profstyles.profession}>UX Designer</span>
                            </div>
                            <div className={profstyles.plus}>
                                <button className="glyphicon glyphicon-plus"></button>
                            </div>
                        </div>
                        <div className={profstyles.friendItem}>
                            <div className={profstyles.photo}>
                                <img src="data:image/jpeg;base64," alt=""/>
                            </div>
                            <div className={profstyles.name}>
                                <span>Karina Lower</span>
                                <span>UX Designer</span>
                            </div>
                            <div className={profstyles.plus}>
                                <button className="glyphicon glyphicon-plus"></button>
                            </div>
                        </div>
                        <div className={profstyles.friendItem}>
                            <div className={profstyles.photo}>
                                <img src="data:image/jpeg;base64," alt=""/>
                            </div>
                            <div className={profstyles.name}>
                                <span>Karina Lower</span>
                                <span>UX Designer</span>
                            </div>
                            <div className={profstyles.plus}>
                                <button className="glyphicon glyphicon-plus"></button>
                            </div>
                        </div>
                        <div className={profstyles.friendItem}>
                            <div className={profstyles.photo}>
                                <img src="data:image/jpeg;base64," alt=""/>
                            </div>
                            <div className={profstyles.name}>
                                <span>Karina Lower</span>
                                <span>UX Designer</span>
                            </div>
                            <div className={profstyles.plus}>
                                <button className="glyphicon glyphicon-plus"></button>
                            </div>
                        </div>
                        <div className={profstyles.friendItem}>
                            <div className={profstyles.photo}>
                                <img src="data:image/jpeg;base64," alt=""/>
                            </div>
                            <div className={profstyles.name}>
                                <span>Karina Lower</span>
                                <span>UX Designer</span>
                            </div>
                            <div className={profstyles.plus}>
                                <button className="glyphicon glyphicon-plus"></button>
                            </div>
                        </div>
                    </div>
                </div>
                <div className={profstyles.middle}>
                    <MyPosts allPosts={this.props.allPosts}
                             dispatch={this.props.dispatch }
                    />
                </div>
                <div className={profstyles.right}>

                </div>
            </div>
        )
    }
}

export default Profile;
